const ADD_MESSAGE = 'ADD-MESSAGE'

let initialState = {
    dialogsData: [
        {
            id: 1, name: 'Alex',
            avatarSrc: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJRujH5UTfH-qirxRzbENkmUvUlaplhoh0ug&usqp=CAU',
            avatarAlt: 'avatar of a person'
        },
        {
            id: 2, name: 'Dimych',
            avatarSrc: 'data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD/' +
                '',
            avatarAlt: 'avatar of a person'
        },
        {
            id: 3, name: 'Andrey',
            avatarSrc: 'data:image/jpeg;base64,',
            avatarAlt: 'avatar of a person'
        },
        {
            id: 4, name: 'Stepa',
            avatarSrc: 'data:image/jpeg;base64,',
            avatarAlt: 'avatar of a person'
        }
    ],
    messagesData: [
        {id: 1, message: 'Hi!'},
        {id: 2, message: 'How are you?'},
        {id: 3, message: "I'm fine.=)"},
        {id: 4, message: 'And you?'},
        {id: 5, message: "I'm OK. =)"},
        {id: 6, message: 'Yo!'},
        {id: 7, message: 'Yo!'}
    ],
    // messageText: 'Hello World =)'
}

const dialogsReducer = (state = initialState, action) => {
    switch (action.type) {
        case ADD_MESSAGE:
            let id = state.messagesData.length + 1
            return {
                ...state,
                messagesData: [...state.messagesData, {id: id, message: action.newMessage}],
            }

        default:
            return state
    }
}

export const sendMessageActionCreator = (newMessage) => ({type: ADD_MESSAGE, newMessage})

export default dialogsReducer
